      display: initial;
    }

    ////_____________________________________________title__desktop_____________________________________________ ////
    @media screen and ( min-width : 1100px ){
      &.title--visible{
        display: none;
      }
      display: block;
      width: 40vw;
      &.title__hidden{
        display: initial;
      }
    }
  }

  .picture{
    display: flex;
    justify-content: space-between;
    overflow: hidden;
    width: 98%;
    margin: auto;
    height: 350px;;
    background: $grisprincipal;
    img{
      padding-left: 2%;
      height: 187px;
      display: none;
      margin: auto auto auto auto;
      &.active{
        display: initial;
      }
    }
    ////_____________________________________________picture--tablet_____________________________________________ ////
    @media screen and ( min-width : 800px ){
      height: 400px;
      img{
        height: 287px;
        width: 344px;
      }
    }
    ////_____________________________________________picture--desktop_____________________________________________ ////
    @media screen and ( min-width : 1100px ){
      background-color: initial;
      margin: initial;

      flex-wrap: wrap;
      flex-direction: row-reverse;
      justify-content: flex-end;
      height: initial;
      width: 1000px;
      img{
        margin: 10px;
        padding: 20px;
        background: $grisprincipal;
        max-width: 226px;
        height: 187px;
        display: initial;
      }
    }
  }

  .squares{
    display: flex;
    width: 200px;
    margin: auto;
    justify-content: space-evenly;
    section{
      transform: translateY(-45px);
      width: 24px;
      height: 24px;
      background-color: #626262;
      &.active{
        background-color: black;
      }
    }
    ////_____________________________________________squares__desktop_____________________________________________ ////
    @media screen and ( min-width : 1100px ){
      display: none;
    }
  }

  .text__description{
    max-height: 35vh;
    overflow: hidden;
    p{
      font-size: 16px;
      line-height: 1.80;
      width: 80vw;
      margin: auto;
      &.prix{
