      }
    }

    &.active{
      max-height: 100%;
    }
    ////_____________________________________________text__description__desktop_____________________________________________ ////
    @media screen and ( min-width : 1100px ){
      width: 45vw;
      height: 50vh;
      text-align: center;
      .title{
        width: initial;
      }
      &.active{
        height: initial;
      }
      p{
        width: 100%;

      }
    }
  }

  .read__next{
    font-size: 18px;
    &:before {
      content: "  ";
      width: 30vw;
      height: 2px;
      display: block;
      margin: 10px auto 5px auto; 
      background-color: black;
    }
    @media screen and ( min-width : 1100px ){
